    public static String decode(String s) {
        String base64 =null;
        try {
             base64 = new String(Base64.getDecoder().decode(s), "utf-8");
        } catch (Exception e) {
            e.printStackTrace();
        }
        return base64;
    }

    /**
     * 获取token
     *
     **/
    public static void getToken() throws Exception {
        CloseableHttpClient httpclient = HttpClients.createDefault();
        HttpPost httpPost = new HttpPost(YysDemo.TOKEN_URL);

        httpPost.setHeader("Content-Type",
                "application/json;charset=UTF-8");
        JSONObject jsonParam=new JSONObject();
        jsonParam.put("apiKey",YysDemo.A_KEY);
        jsonParam.put("securityKey",YysDemo.S_KEY);
        StringEntity entity = new StringEntity(jsonParam.toString(), "utf-8");
        httpPost.setEntity(entity);
        CloseableHttpResponse response = httpclient.execute(httpPost);
        String result= EntityUtils.toString(response.getEntity());
        System.out.println(result);
        String token=null;

        JSONObject jsonResult=JSONObject.fromObject(result);
        String data=jsonResult.getString("data");
        JSONObject dataResult=JSONObject.fromObject(data);
        token=dataResult.getString("token");
        System.out.println(token);
        getAuthUrl(token);
    }

